import React from 'react';

export default function CurrencyRow(props){
    const {currencyOptions, selectedCurrency,onChangeCurrency,amount}= props;
    return(<div>
        <input type=''/>
        <select value={selectedCurrency} onChange={onChangeCurrency} value={amount}>
            {currencyOptions.map(currencyOption=><option key={currencyOption} value={currencyOption }>{currencyOption}</option>)}

        </select>


    </div>)
}
